import React from 'react';
import Navigation from '../components/Navigation';

const Home = () => {
    return (
        <div className="home">
            <Navigation />
            <div className="homeContent">
                <div className="content">
                    <h1>Bret Marian</h1>
                    <h2>Développeur FullStack</h2>
                    <div className="pdf">
                        <a href="./media/CV.pdf" target="_blank">Télécharger le CV</a>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
